import React from 'react'
import { Helmet } from 'react-helmet'

const MetaData = ({ title }) => {
    return (
        <Helmet>
            <title>{`${title} -Em Nam Lả Lướt`}</title>
        </Helmet>
    )
}

export default MetaData
